import React, { useState } from 'react';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';



const Icon = (props) => {

  return (
    // <div style={{width: 50, height: 40,margin: 5, fontSize: "0.5em", display: 'inline'}}>
        <FontAwesomeIcon size="0.5em" {...props} />
    // </div>
  );
}

export default Icon;
